import React, { useState } from 'react';

function Carrito() {
  const [productos, setProductos] = useState([]);

  return (
    <div>
      <h2>Carrito de Compras</h2>
      <ul>
        {productos.map((producto, index) => (
          <li key={index}>{producto.nombre} - ${producto.precio}</li>
        ))}
      </ul>
    </div>
  );
}

export default Carrito;
